import React from "react"
import Data from "./Data"
import './index.css'
function Prodact(){


      const arr=Data.map((el)=>{
        return(
         
        <div className="CardList" key={el.id}>
            
            <img src={el.image} alt="" />
            <h1>{el.title}</h1>
            <p>{el.description}</p>
    
        
            
            </div>

        )

    
    })
    return(<div>
<div className="List">
   
    {arr}
   


</div>
</div>
    )
    }
export default Prodact
